import React from 'react';
import Item from './Item';

class App extends React.Component {
    constructor() {
        super();
        this.state = {
            data: [
                { name: 'Milk' },
                { name: 'Bread' },
                { name: 'Butter' }
            ]
        }
    }

    render() {
        return (
            <ul>
                {this.state.data.map(function(v) {
                    return <Item name={v.name} />
                })}
            </ul>
        )
    }
}

export default App;
